import './AddCategoryForm.css';
import { useRef } from 'react';

function AddCategoryForm(props) {
  const nameInputRef = useRef();
  const typeInputRef = useRef();
  function formSubmitHandler(e) {
    e.preventDefault();
    const nameValue = nameInputRef.current.value;
    const typeValue = typeInputRef.current.value;
    const category = {
      name: nameValue,
      type: typeValue
    }
    props.onAddCategory(category);
  }

  return (
    <form onSubmit={formSubmitHandler}>
      <label>Kategooria nimi</label><br />
      <input type="text" placeholder="Nimi" required ref={nameInputRef} /><br />
      <label>Kategooria</label><br />
      <input type="text" placeholder="Tüüp" required ref={typeInputRef} /><br />
      <label>Võimalikud kategooria tüübid:</label>
      <label>Premium</label>
      <label>Kodutarbed</label>
      <label>Vabaaeg</label>
      </form>
  );
}

export default AddCategoryForm;
